import React from 'react'
import { AiOutlineFolder, AiFillGithub } from "react-icons/ai";

export default function other() {
  return (
    <div className='flex flex-row max-w-[1200px] mx-auto text-[white]'>
        <div>
            <div className=' justify-between flex flex-row'>
                <AiOutlineFolder/>
                <a href='https://github.com/shivamkumarsha'><AiFillGithub/></a>
                Github Projects

            </div>


        </div>
    </div>
  )
}
